import { useSelector } from "react-redux";
import { useEffect, useState } from "react";
import "./AdminDashboard.css";
// import { response } from "../../../backend/app";
let outerResponse;
const AdminDashboard = () => {
  const users = useSelector((state) => state.user);
  const [fetched, setFetched] = useState(false);
  const [outerResponse, setOuterResponse] = useState([]);
  const fetchAllUsers = async () => {
    const response = await fetch("http://localhost:8080/demo", {
      method: "GET",
    });
    const data = await response.text();
    console.log(await JSON.parse(data));
    setOuterResponse(JSON.parse(data));
    console.log("type", typeof JSON.parse(data));
    console.log("outerREsonse in useEffect", outerResponse);
    console.log("in Admin Dashboard", data);
  };
  useEffect(() => {
    fetchAllUsers();
    setFetched(true);
    // response = await fetch("http://localhost:8080/demo", {
    //   method: "GET",
    // });
    // console.log("in useEffect", response);
    return () => {};
  }, []);

  return (
    <div id="adminDashboard">
      <h1>Hello</h1>
      <table>
        <th>
          <td>User</td>
          <td>Round 1</td>
          <td>Round 2</td>
          <td>Round 3</td>
          <td>Round 4</td>
          <td>Round 5</td>
          <td>Overall</td>
        </th>
        {fetched &&
          outerResponse.map((item) => (
            <tr>
              <td>{item.userId}</td>
              <td>{item.stage1Time}</td>
              <td>{item.stage2Time}</td>
              <td>{item.stage3Time}</td>
              <td>{item.stage4Time}</td>
              <td>{item.stage5Time}</td>
              <td>{item.overallTime}</td>
            </tr>
          ))}
      </table>
      {/* {outerResponse} */}
    </div>
  );
};

export default AdminDashboard;
